- input: "TEXT\x1CC00041269\x1CX0\x1C\x1CF3XA\x1CThis Amendment is in response to
    the Commission's letter dated July 7, 2011. The corrections for Schedule L Aggregation
    Page have been made, and are included in this report. Payments for 'Payroll,'
    'Payroll Taxes' and 'Health Insurance' on Schedule H4 are for those individuals
    who did not spend more than 25% of their time during the period on activity in
    connection with a  federal election. The receipt on Line 17 are for voter file
    purchases. The prices paid for voter file purchases are established using comparable
    prices charged by other state party committees hroughout the country on a per
    record cost. The exact price paid to the Committee by each entity is determined
    by multiplying the per record cost by the number of records provided in the file
    purchased.\n"
